import React, { useState } from 'react';
import QrScanner from 'react-qr-scanner';
import './HomePage.css';

function HomePage() {
  const [result, setResult] = useState('');
  const [showScanner, setShowScanner] = useState(false);
  const [showGoods, setShowGoods] = useState(false);
  const [goodsList, setGoodsList] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  const handleScan = (data) => {
    if (data) {
      setResult(data.text);
      setShowScanner(false);

      // Ask to import or export
      const action = window.confirm('Do you want to import or export? Press OK for import, Cancel for export.');
      if (action) {
        handleImport(data.text);
      } else {
        handleExport(data.text);
      }
    }
  };

  const handleError = (err) => {
    console.error(err);
  };

  const handleImport = (item) => {
    try {
      const parsedItem = JSON.parse(item);
      const existingItemIndex = goodsList.findIndex(good => good.item === parsedItem.item);

      if (existingItemIndex > -1) {
        // Update existing item
        const updatedGoodsList = [...goodsList];
        updatedGoodsList[existingItemIndex] = {
          ...updatedGoodsList[existingItemIndex],
          quantity: parsedItem.quantity,
          expiryDate: parsedItem.expiryDate,
          weight: parsedItem.weight,
          date: new Date().toLocaleDateString(),
          added: true
        };
        setGoodsList(updatedGoodsList);
      } else {
        // Add new item
        setGoodsList(prevList => [
          ...prevList,
          {
            ...parsedItem,
            date: new Date().toLocaleDateString(),
            added: true
          }
        ]);
      }
    } catch (error) {
      console.error('Failed to parse item:', error);
    }
  };

  const handleExport = (item) => {
    try {
      const parsedItem = JSON.parse(item);
      setGoodsList(prevList => prevList.filter(good => good.item !== parsedItem.item));
    } catch (error) {
      console.error('Failed to parse item:', error);
    }
  };

  const handleViewGoods = () => {
    setShowGoods(true);
    setResult(''); // Clear the result when viewing goods
  };

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value || ''); // Ensure searchTerm is always a string
  };

  // Filter goods based on search term
  const filteredGoods = goodsList.filter(good =>
    good.item && good.item.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div>
      <h2>Warehouse Management</h2>
      <button onClick={() => setShowScanner(true)}>Scan Goods</button>
      <button onClick={handleViewGoods}>View Goods</button>

      {showScanner && !showGoods && (
        <div className="qr-scanner-container">
          <QrScanner
            delay={300}
            onError={handleError}
            onScan={handleScan}
            className="qr-scanner"
          />
        </div>
      )}

      {showGoods && (
        <div className="goods-list">
          <h3>Available Goods</h3>
          <input
            type="text"
            placeholder="Search goods..."
            value={searchTerm}
            onChange={handleSearchChange}
            className="search-input"
          />
          <table>
            <thead>
              <tr>
                <th>Item Name</th>
                <th>Quantity</th>
                <th>Expiry Date</th>
                <th>Weight</th>
                <th>Date Scanned</th>
                <th>Added</th>
              </tr>
            </thead>
            <tbody>
              {filteredGoods.map((good, index) => (
                <tr key={index}>
                  <td>{good.item}</td>
                  <td>{good.quantity}</td>
                  <td>{good.expiryDate}</td>
                  <td>{good.weight}</td>
                  <td>{good.date}</td>
                  <td>{good.added ? 'Yes' : 'No'}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {!showGoods && result && (
        <p>Scanned Result: {result}</p>
      )}
    </div>
  );
}

export default HomePage;
